import Head from "./components/Head";
import Body from "./components/Body";
import { BrowserRouter } from "react-router-dom";

import "./css/styles.css";
import "./css/variables.css";
import React from "react";

function App() {
  return (
    <BrowserRouter>
      <html>
        <Head />
        <Body />
      </html>
    </BrowserRouter>
  );
}

export default App;
